import styles from './about.module.css'

const About = () => {
  return (
    <div className={styles.text}>
      Las respuesta en el TA-TE-TI están generadas en base al algorítmo <a href="https://es.wikipedia.org/wiki/Minimax" target="_">minimax</a>.
      Como dice Wikipedia "minimax es un método de decisión para minimizar la pérdida máxima esperada en juegos con adversario y con información perfecta".

    </div>
  )
}

export default About
